import React from 'react'

const Test = () => {
    const data = [
        {
        id:1,
        name: "Naresh",
        age: 29,
        isMarried: false
        },
        {
        id:2,
        name: "Anji",
        age: 35,
        isMarried: true
        },
        {
        id:3,
        name: "Somesh",
        age: 30,
        isMarried: false
        }
        ]

        const filtered = data.filter(item => item?.age > 29)
        const output = filtered.map(item => {
            return <>
            <ul>
                <li>{output}</li>
            </ul>
            </>
        }

        )
        console.log(output);
  return (
    <div>Test</div>
  )
}

export default Test
